Всем привет!
Всё ещё ищем разработчика рекомендательной системы в онлайн-кинотеатр <http://ivi.ru|ivi.ru>. У нас небольшая команда: 7 разработчиков, аналитик и два тестировщика.
Нужно будет внедрять новые алгоритмы в рекомендательный сервис.

*Город:*
Москва

*Требования к кандидатам:*

_Обязанности_
* Разработка нагруженного сервиса выдачи рекомендаций;
* Полный цикл ML: сбор и подготовка данных, обучение моделей, выкатывание решения в продакшн.
* Идеальный кандидат умеет прочитать статью  и реализовать прототип модели

_Требования к кандидату_
* python3;
* классические алгоритмы ML;
* SQL (+ желательно PySpark);
* Linux - нужно уметь зайти по ssh на удалённую машину и что-нибудь поделать в консоли;

_Условия_
* Офис рядом с метро "Дмитровская", напротив дизайн-завода "Флакон";

*Вилка зарплат:*
От 120000 до 180000 руб. на руки

Всем доброго дня!

Ищем кандидата на позицию Chief data scientist:
Минск, РБ, БПС-Сбербанк

Цель проекта:
Создание в Банке платформы предиктивной аналитики.

Основные обязанности (кратко):
•	Формирование требований к данным Банка;
•	Полный цикл работы с  ML моделями для различных процессов банка (в основном клиентская аналитика);
•	Сбор и анализ требований бизнеса.
Предъявляемые требования к кандидатам:
•	Опыт успешной реализации и внедрения в продакшн ML проектов;
•	Знание инфраструктуры и библиотек машинного обучения;
•	Уверенный python;
•	Умение работать на кластере.
•	git, Jira
•	Опыт работы с Hadoop (Hive, Spark, HBase) - плюс;
•	Знания финансового сектора – плюс.
Мы предлагаем нашим сотрудникам:
•	Интересный масштабный проект по созданию архитектуры данных в банковской сфере;
•	Заработная плата от  1500 y.e  и социальный пакет (медицинская страховка, материальная помощь к отпуску, выплата по итогам года, скидки на спортивные/культурные мероприятия, тимбилдинг, подарки на новый год, 23 февраля/8 марта и т.д.);
•	Команда высокопрофессиональных специалистов объединённых общими целями;
•	Корпоративное  обучение,  профессиональное и карьерное развитие.
